import React from "react";
import "./App.scss";
import { FilmList, Header, Select } from "./components";

function App() {
  return (
    <div className="app">
      <Header />
      <div className="content">
        <Select />
        <FilmList filmList={[{ id: 1 }, { id: 2 }, { id: 3 }]} />
      </div>
    </div>
  );
}

export default App;
